# Algorithm for the money gain by streak
streak_wins_money_multiplicator=3


###################
# Bounty settings #
###################

# General settings
bounty_enabled=1
bounty_min=500
bounty_max=5000
bounty_del=30


#################
# Hunt settings #
#################

# General settings
hunt_enabled=0
hunt_strictmode=0
hunt_money_per_prey=10
hunt_winner_money=100
hunt_start_between_flagtime=0


######################
# Challenge settings #
######################

# General settings
duel_enabled=1
duel_database_enabled=1
# Arena when new duel or to announce a winner?
duel_announce_new=1
duel_announce_winner=1
