duel_area5_ship=2,8


#############################
# Flag Time Module settings #
#############################

# General setting
flagtime_enabled=1

# Warp settings
# Allow usage of the !warp command.
allow_warp=1
# Automatically warp players to the FR.
auto_warp=1


################
# Money system #
################

