######################## BEGIN STORE HELP
# STORE ITEMS SECTION ##
########################
#
# STORE - Options for each item
# Please note, some will work only for a specific item (Prize, Ship or Command)
# Descriptions cannot have a comma
#
#    !s<x>         : to restrict a ship (x) to buy this item
#    !mp<x>        : to restrict a player to buy (x) times the same item during a life
#    !mc<x>        : to restrict a player to buy (x) times the same item consecutively
#    !ri_<x>       : to restrict a player to buy this item if he has an active item named <x> 
#                    to use in tandem with !dm or !ds (!dd not implemented yet for !ri)
#    !dd<x>        : item lost after (x) DEATHS (for ship items only)
#    !dm<x>        : item lost after (x) MINUTES (for ship/prize items only)
#    !ds<x>        : item lost after (x) SECONDS (for ship/prize items only)
#    !dsm<x>       : item buyable only 1 time every (x) SECONDS (for the player only)
#    !adm<x>       : item buyable only 1 time every (x) MINUTES (for the whole arena)
#	 !fdm<x>	   : item buyable only 1 time every (x) MINUTES (for the freq only)
#    !fdr<x>       : item buyable only x times per freq per round
#    !pf           : item only buyable for freqs 0 and 1
#	 !fit<x>	   : affected freqs immune for (x) SECONDS
#    !arena        : to *arena if someone buy this item
#    !fromspec     : item buyable from spec
#    !abbv_<x>     : abbreviation for the item_name (multiple possible)
#    !player       : a player can buy this item for someone else (!buy item1:PlayerA)
#    !strictplayer : this item must be supplied with a player name, not optional
#    !hidden       : hidden command, not listed
#
